        <Box onSubmit={() => {
            console.log("anda");
        }}>
            <TextField variant="outlined" defaultValue="" label="Ingrese un nombre de usuario" required/>
            <Button type="submit" variant="contained">Submit</Button>
        </Box>
    );
}


export default Auth;
